/*
 * STRUCT: SE_Class_Data
 *
 *   This structure describes all of the relationships of a SEDRIS class.
 *   Any object of a given class type is required to meet all of the
 *   requirements for that class type.  Those relational requirements
 *   of a class are defined by the SE_Class_Data structure for that class.
 *
 *   The SE_ClassData array (see below) is an array of these SE_Class_Data
 *   structs, so that there is one entry for each type of class in SEDRIS.
 *
 *   abstract_class - a flag, set to SE_TRUE if this class is abstract
 *
 *   link_class - a flag, set to SE_TRUE if this class is a link class
 *
 *   super_class - the DRM Class of the superclass of this class.  If
 *                 this class does not have a superclass, then this field
 *                 is set to SE_DRM_CLS_NULL.  In SEDRIS, each class has
 *                 at most one superclass.
 *
 *   component_count - number of SE_Requirements in component_list_ptr
 *
 *   component_list_ptr - the list of SE_Requirements that define the
 *                        requirements for all of the components of this
 *                        class. There is one SE_Requirement for each type
 *                        of class which can be a component of the current
 *                        class. Components participate in aggregation
 *                        relationships with, or are 'aggregated together' by,
 *                        the current class.
 *
 *   aggregate_count - number of SE_Requirements in aggregate_list_ptr
 *
 *   aggregate_list_ptr - the list of SE_Requirements that define the
 *                        aggregate requirements for this class (the
 *                        classes for which this class is a component).
 *                        There is one SE_Requirement for each type of
 *                        class of which the current class can be a component
 *                        through a two-way aggregation.
 *
 *   association_count - number of SE_Requirements in the list pointed
 *                       to by association_list_ptr
 *
 *   association_list_ptr - the list of SE_Requirements that define the
 *                          requirements for all of the associations of this
 *                          class.  There is one SE_Requirement for each
 *                          type of class which can be an associate of the
 *                          current class.
 */
typedef struct
{
    SE_Boolean           abstract_class;
    SE_Boolean           link_class;
    SE_4p0_DRM_Class          super_class;
          SE_Short_Integer_Unsigned  component_count;
    const SE_Requirement            *component_list_ptr;

          SE_Short_Integer_Unsigned  aggregate_count;
    const SE_Requirement            *aggregate_list_ptr;

          SE_Short_Integer_Unsigned  association_count;
    const SE_Requirement            *association_list_ptr;
} SE_Class_Data;


