/*
 *----------------------------------------------------------------------------
 *
 * FUNCTION: SE_4p0_DRMClassStringToDRMClass
 *
 *----------------------------------------------------------------------------
 */
SE_DRM_Status_Code
SE_4p0_DRMClassStringToDRMClass
(
    const char          *name_ptr,
          SE_4p0_DRM_Class *drm_class_ptr
)
{
    SE_DRM_Status_Code status = SE_DRM_STAT_CODE_INVALID_CLASS;
    SE_4p0_DRM_Class curr_class = (SE_4p0_DRM_Class)(SE_4P0_DRM_CLS_NULL+1);

    *drm_class_ptr = SE_4P0_DRM_CLS_NULL;
    while ((curr_class < SE_4P0_NUM_DRM_CLASSES) &&
           (status != SE_DRM_STAT_CODE_SUCCESS))
    {
        if (se_strcasecmp(SE_ConfigInfoClasses[curr_class].name_ptr,
            name_ptr)==0)
        {
            *drm_class_ptr = curr_class;
            status         = SE_DRM_STAT_CODE_SUCCESS;
        }
        else
        {
            curr_class = (SE_4p0_DRM_Class)(curr_class + 1);
        }
    }
    return status;
} /* end SE_4p0_DRMClassStringToDRMClass */


/*
 *----------------------------------------------------------------------------
 *
 * FUNCTION: SE_4p0_EnumerantName
 *
 *----------------------------------------------------------------------------
 */
SE_DRM_Status_Code
SE_4p0_EnumerantName
(
          SE_4p0_DRM_Type   drm_type,
          SE_Integer        value,
    const char             **result_ptr
)
{
    SE_DRM_Status_Code status = SE_DRM_STAT_CODE_INVALID_TYPE_CLASSIFICATION;

    *result_ptr = NULL;
    if (!SE_ValidNonNull4p0DRMType(drm_type))
    {
        status = SE_DRM_STAT_CODE_INVALID_TYPE;
    }
    else if (SE_ConfigInfoTypes[drm_type].type_classification ==
             SE_TYP_CLASSIF_ENUM)
    {
        SE_Short_Integer_Unsigned i = 0;

        status = SE_DRM_STAT_CODE_INVALID_ENUMERANT;
        while ((i < SE_ConfigInfoTypes[drm_type].field_count) &&
               (status != SE_DRM_STAT_CODE_SUCCESS))
        {
            if (SE_ConfigInfoTypes[drm_type].u.enum_field[i].value == value)
            {
                *result_ptr = SE_ConfigInfoTypes[drm_type].
                              u.enum_field[i].name_ptr;
                status      = SE_DRM_STAT_CODE_SUCCESS;
            }
            else
                i++;
        }
    }
    else if (SE_ConfigInfoTypes[drm_type].type_classification ==
             SE_TYP_CLASSIF_REGISTERABLE_ENUM)
    {
        SE_Short_Integer_Unsigned i = 0;

        status = SE_DRM_STAT_CODE_INVALID_ENUMERANT;
        while ((i < SE_ConfigInfoTypes[drm_type].field_count) &&
               (status != SE_DRM_STAT_CODE_SUCCESS))
        {
            if (SE_ConfigInfoTypes[drm_type].u.registerable_enum_type.
                enum_field[i].value == value)
            {
                *result_ptr = SE_ConfigInfoTypes[drm_type].
                              u.registerable_enum_type.
                              enum_field[i].name_ptr;
                status      = SE_DRM_STAT_CODE_SUCCESS;
            }
            else
                i++;
        }
    }
    return status;
} /* end SE_4p0_EnumerantName */


