/*
 *----------------------------------------------------------------------------
 *
 * FUNCTION: SE_4p0_FieldIndexForClass
 *
 *----------------------------------------------------------------------------
 */
SE_DRM_Status_Code
SE_4p0_FieldIndexForClass
(
          SE_4p0_DRM_Class drm_class,
    const char                      *mem_name_ptr,
          SE_Short_Integer_Unsigned *index_ptr
)
{
    SE_DRM_Status_Code status =
                            SE_DRM_STAT_CODE_INVALID_CLASS_FIELD;

    if (!SE_ValidNonNull4p0DRMClass(drm_class))
    {
        status     = SE_DRM_STAT_CODE_INVALID_CLASS;
        *index_ptr = 0;
    }
    else
    {
        const SE_Class_Structure        *class_info_ptr;
              SE_Short_Integer_Unsigned  i = 0;

        class_info_ptr = &SE_ConfigInfoClasses[drm_class];
        while ((status != SE_DRM_STAT_CODE_SUCCESS) &&
               (i < class_info_ptr->field_count))
        {
            if (se_strcasecmp(mem_name_ptr,
                              class_info_ptr->fields[i].name_ptr)==0)
            {
                *index_ptr = i;
                status     = SE_DRM_STAT_CODE_SUCCESS;
            }
            else
                i++;
        }
    }
    return status;
} /* end SE_4p0_FieldIndexForClass */


