/*
 *----------------------------------------------------------------------------
 *
 * FUNCTION: SE_4p0_PredefinedFunctionDefinition
 *
 *----------------------------------------------------------------------------
 */
SE_DRM_Status_Code
SE_4p0_PredefinedFunctionDefinition
(
          SE_4p0_Predefined_Function func,
    const SE_4p0_Predef_Func_Structure **type_ptr
)
{
    SE_DRM_Status_Code status   = SE_DRM_STAT_CODE_INVALID_CLASS;
    SE_4p0_DRM_Type drm_type = SE_4P0_DRM_TYP_SE_4P0_PREDEFINED_FUNCTION;
    const SE_Enumerant_Structure *enum_ptr;
          SE_Integer_Unsigned     i = 0;

    *type_ptr = NULL;
    enum_ptr  = SE_ConfigInfoTypes[drm_type].u.enum_field;
    while ((status != SE_DRM_STAT_CODE_SUCCESS) &&
           (i < SE_ConfigInfoTypes[drm_type].field_count))
    {
        if (enum_ptr[i].value == func)
        {
            status    = SE_DRM_STAT_CODE_SUCCESS;
            *type_ptr = &SE_PredefinedFunctionTypes[i];
        }
        else
            i++;
    }
    return status;
} /* end SE_4p0_PredefinedFunctionDefinition */


